import Link from 'next/link'
import styles from './styles.module.scss';

function Button({
    text,
    url,
}) {

    const imgSrc = 'asset/button-arrow.svg';
    return (
        <Link href={url}>
            <div className={styles.button_container}>
                <a>
                    <p>{text}</p>
                    <img src={imgSrc} alt=''/>
                </a>
            </div>
        </Link>
    )
}

export default Button;
